[SuppressBPWarning('BPErrorFilterPropertiesControlsCannotHaveOverrides', 'Depending on the VendorFilter being used or not, PurchRFQVendLink datasource needs to be enabled/disabled.')]
public boolean modified()
{
    VendAccount vendAccount = this.text();

    if (vendAccount)
    {
        purchRFQCaseTable_DS.query().dataSourceTable(tableNum(PurchRFQVendLink)).enabled(true);
    }
    else
    {
        purchRFQCaseTable_DS.query().dataSourceTable(tableNum(PurchRFQVendLink)).enabled(false);
    }

    return super();
}
